import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 32, height: 32, viewBox: "0 0 32 32", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M16 25a9 9 0 100-18 9 9 0 000 18zm0-23a14 14 0 100 28 14 14 0 000-28zM4 16a12 12 0 1124 0 12 12 0 01-24 0z", fill: primaryFill }));
};
const Record32Regular = wrapIcon(rawSvg({}), 'Record32Regular');
export default Record32Regular;
